import React, { component } from "react";

class TodoList extends component {
  render() {
    return (
      <div className="main">
        <div className="header">
          <form>
            <input placeholder="Task" />
            <button type="submit">Add Task</button>
          </form>
        </div>
      </div>
    );
  }
}
